Você sabia que se você não aceitar mais a Frequência do medo, você não experimentará mais seus EFEITOS em sua Vida? Mesmo que alguém tenha uma intenção negativa em relação a você, VOCÊ SERÁ INVISÍVEL nessa frequência. Quando você começa a entender qual é o nosso ponto fraco, você começa a ver a luz dos lugares mais altos. Não permita que o medo entre em você. Autoconfiança verticalmente é o antivírus. torne-se o verdadeiro Relâmpago Azul e você deixará de ver inimigos em todos os cantos. Além de qualquer aspecto positivo ou negativo, há harmonia. Esta é a nota do universo... esta é a frequência criativa dos mundos. Esta é a faixa em que a energia é impulsionada. Esta é a sua verdadeira autoridade. "Minha firmeza não implica ser resoluto para lutar contra o outro, minha firmeza é saber ficar no meu centro apesar do outro"
